import React from "react";
import "./styles.css";

export default function App() {
  return (
    <Button
      color="blue"
      disable={false}
      text="knopf lol"
      nachricht={handleClick}
    />
  );
}

function handleClick(props) {
  console.log("Click");
}

const MyComponent = (props) => {
  if (props.disable) {
    return <p>This is rendered when the condition is true.</p>;
  } else {
    return <p>This is rendered when the condition is false.</p>;
  }
};

function Button(props) {
  if (props.disable) {
    return (
      <button color={props.color} disabled={props.disable}>
        {props.text}
      </button>
    );
  } else {
    return (
      <button
        color={props.color}
        disabled={props.disable}
        onClick={props.nachricht}
      >
        {props.text}
      </button>
    );
  }
}
